import React from 'react';
import {Carousel} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import Image1 from './Image/slider-3.jpg';
import Image2 from './Image/slider-2.jpg';
import Image3 from './Image/slider-1.jpg';
import Image4 from './Image/slider-4.jpg';

function slid() {
  const img = {
        width: '100%'
      }
  return (
    <div>
      <h1>slider</h1>
      <hr />
      <Carousel>
        <Carousel.Item>
          <img src={Image1} alt="img1" height="300px" width="300px" />
        </Carousel.Item>
        <Carousel.Item>
          <img src={Image2} alt="img1" height="300px" width="300px" />
        </Carousel.Item>

        <Carousel.Item>
        <img
          style={img}
          className="d-block w-100"
          src={Image3}
          alt="Third slide"
        />

        <Carousel.Caption>
          <h3>Third slide label</h3>
          <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
        </Carousel.Caption>
        </Carousel.Item>

        <Carousel.Item>
        <img
          style={img}
          className="d-block w-100"
          src={Image4}
          alt="Third slide"
        />
        <Carousel.Caption>
           <h3>Four slide label</h3>
           <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
         </Carousel.Caption>
        </Carousel.Item>
        
      </Carousel>
    </div>
  )
}

export default slid;
